import React from 'react';

function Home() {
  return (
    <div className="text-center p-5">
      <h1 className="display-4">Bem-vindo ao Sistema</h1>
      <p className="lead">Selecione uma das opções no menu de navegação para começar.</p>
    </div>
  );
}

export default Home;
